class App extends React.Component {
  constructor() {
    super();
    this.state = {
      count: 0,
      Values:
        localStorage.getItem("Values") == undefined
          ? []
          : localStorage.getItem("Values"),
      textvalue: "",
    };
    //this.Values = [];
    //this.textvalue = "text";
    this.Addvalue = this.Addvalue.bind(this);
    //const [textvalues, setState] = useState("");
    const fs = require("fs");
    let raw = fs.readFileSync("./Data.json");
    let itemList = JSON.parse(raw);
    //console.log(itemList);
  }

  increase(prop) {
    let floors = [...this.state.Values];

    // Add item to it
    floors.push({ prop });

    // Set state
    this.setState({ floors });
    //this.setState({ Values: Values.push(prop) });
  }

  Item = (props) => {
    const { sx, ...other } = props;
    console.log("test");
    console.log(props);
    if (props.children !== "No information") {
      return (
        <Box
          sx={{
            mt: 2,
            bgcolor: (theme) =>
              theme.palette.mode === "dark" ? "#101010" : "#fff",
            color: (theme) =>
              theme.palette.mode === "dark" ? "grey.300" : "grey.800",
            border: "1px solid",
            borderColor: (theme) =>
              theme.palette.mode === "dark" ? "grey.800" : "grey.300",
            p: 1,
            m: 1,
            "&:hover": {
              backgroundColor: "primary.dark",
              opacity: [0.9, 0.8, 0.7],
            },
            display: "flex",
            justifyContent: "space-between",
            alignItems: "center",
            borderRadius: 2,
            fontSize: "0.875rem",
            fontWeight: "700",
            ...sx,
          }}
          {...other}
        >
          <label>{props.children}</label>

          <Button
            variant="contained"
            sx={{
              width: "25px !important",
            }}
            startIcon={<DeleteIcon sx={{ marginLeft: "8px" }} />}
            onClick={this.Addvalue}
          ></Button>
        </Box>
      );
    } else {
      return (
        <Box
          sx={{
            mt: 2,
            bgcolor: (theme) =>
              theme.palette.mode === "dark" ? "#101010" : "#fff",
            color: (theme) =>
              theme.palette.mode === "dark" ? "grey.300" : "grey.800",
            border: "1px solid",
            borderColor: (theme) =>
              theme.palette.mode === "dark" ? "grey.800" : "grey.300",
            p: 1,
            m: 1,
            "&:hover": {
              backgroundColor: "primary.dark",
              opacity: [0.9, 0.8, 0.7],
            },
            display: "flex",
            justifyContent: "space-between",
            alignItems: "center",
            borderRadius: 2,
            fontSize: "0.875rem",
            fontWeight: "700",
            ...sx,
          }}
          {...other}
        >
          <label>{props.children}</label>
        </Box>
      );
    }
  };
  handleDelete = (e) => {
    console.log(e);
  };
  Addvalue(evt) {
    //console.log(this.state.textvalue);
    if (this.state.textvalue.length > 0) {
      evt.preventDefault();
      if (localStorage.getItem("Values") === undefined) {
        localStorage.setItem("Values", []);
      }
      let tasks = this.state.Values;
      let textvalue = this.state.textvalue;
      tasks.push(textvalue);
      localStorage.setItem("Values", tasks);
      this.setState({ textvalue: "" });
      this.setState({ Values: tasks });
    }
    //console.log(this.state.Values);
  }
  updateInput = (evt) => {
    this.setState({ textvalue: evt.target.value });
  };
  handleKeypress = (e) => {
    //it triggers by pressing the enter key
    console.log(e);
    if (e.charCode === 13 && this.state.textvalue.length > 0) {
      this.Addvalue(e);
    }
  };
  render() {
    console.log(this.state.Values);
    let vals = this.state.Values;
    console.log(typeof vals);
    return (
      <div style={{ margin: "50px" }}>
        <Stack direction="row" justifyContent="center">
          <Box
            component="div"
            sx={{
              "& > :not(style)": {
                m: 1,
                width: "50ch",
              },
              display: "contents",
            }}
            noValidate
            autoComplete="off"
          >
            <TextField
              id="standard-basic"
              label="Standard"
              variant="standard"
              value={this.state.textvalue}
              onChange={this.updateInput}
              onKeyPress={this.handleKeypress}
              sx={{
                width: "80%",
              }}
            />

            <Button
              variant="contained"
              sx={{
                width: "92px !important",
              }}
              startIcon={<AddCircle />}
              onClick={this.Addvalue}
            >
              Add
            </Button>
          </Box>
        </Stack>
        <Stack direction="row" justifyContent="center">
          <Box
            component="div"
            sx={{
              "& > :not(style)": {
                m: 1,
                width: "50ch",
              },
              mx: "2px",
              transform: "scale(0.8)",
              display: "contents",
            }}
            noValidate
            autoComplete="off"
          >
            <Box sx={{ display: "grid", gridTemplateRows: "repeat(3, 1fr)" }}>
              {this.state.Values.length !== 0 ? (
                vals.map((Va) => <this.Item>{Va}</this.Item>)
              ) : (
                <this.Item>No information</this.Item>
              )}
            </Box>
            {/* <List
              sx={{
                width: "100%",
                maxWidth: "100%",
                bgcolor: "background.paper",
                position: "relative",
                overflow: "auto",
                maxHeight: 300,
                backgroundColor: "gray",

                "& ul": { padding: 0 },
              }}
              subheader={<li />}
            >
              {this.state.Values.length !== 0 ? (
                vals.map((Va) => (
                  <li
                    key={`section-${Va}`}
                    sx={{
                      "& > :not(style)": {
                        m: 1,
                        width: "50ch",
                      },
                      marginBottom: "10px",
                    }}
                  >
                    <ul>
                      <Card
                        sx={{
                          minWidth: 275,
                          marginTop: "5px",
                          marginBottom: "5px",
                        }}
                      >
                        <CardContent>
                          <Typography
                            sx={{ fontSize: 14 }}
                            color="text.secondary"
                            gutterBottom
                          >
                            {` ${Va}`}
                          </Typography>
                        </CardContent>
                      </Card>
                      {/* <ListSubheader>{` ${Va}`}</ListSubheader> */}
            {/* {[this.state.Values].map((item) => ( */}
            {/* <ListItem key={`item-${Va}`}>
                        <ListItemText primary={`${Va}`} />
                      </ListItem> 
                      {/* ))} 
                    </ul>
                  </li>
                ))
              ) : (
                <ListSubheader
                  sx={{
                    color: "white",
                    backgroundColor: "gray",
                    paddingBottom: "0",
                  }}
                >
                  No Data Available..
                </ListSubheader>
              )}
            </List> */}
          </Box>
        </Stack>
      </div>
    );
  }
}

export default App;
